import React from 'react'
import appan from './appan.jpg';
import styles from './Simple.module.css';

const Simple = (props) => {
  return (
    <>
    <div className={styles.card}>
        <img src={appan}alt="" />
        <h1>{props.name}</h1>
        <p>{props.price}</p>
    </div>
    </>
  )
}

export default Simple
